import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './StudentDashboard.css';
import CertificateOfRegistration from './CertificateOfRegistration';

const StudentDashboard = ({ studentData }) => {
  const navigate = useNavigate();
  const [activeSection, setActiveSection] = useState('dashboard');
  const [sidebarOpen, setSidebarOpen] = useState(true);
  const [darkMode, setDarkMode] = useState(false);
  const [notifications, setNotifications] = useState([]);
  const [unreadCount, setUnreadCount] = useState(0);
  const [showNotifications, setShowNotifications] = useState(false);
  const [showCORModal, setShowCORModal] = useState(false);
  const [searchQuery, setSearchQuery] = useState('');

  const handleLogout = () => {
    navigate('/login');
  };

  // Mock notifications data
  useEffect(() => {
    const mockNotifications = [
      { id: 1, type: 'academic', title: 'Grades Updated', message: 'Your midterm grades are now available', timestamp: '2024-01-15', read: false },
      { id: 2, type: 'system', title: 'System Maintenance', message: 'Portal maintenance scheduled for Sunday', timestamp: '2024-01-14', read: false },
      { id: 3, type: 'academic', title: 'Document Ready', message: 'Your COR is ready for download', timestamp: '2024-01-13', read: true },
    ];
    setNotifications(mockNotifications);
    setUnreadCount(mockNotifications.filter(n => !n.read).length);
  }, []);

  // COR Modal handlers
  const handleOpenCORModal = () => {
    setShowCORModal(true);
  };

  const handleCloseCORModal = () => {
    setShowCORModal(false);
  };

  const toggleSidebar = () => {
    setSidebarOpen(!sidebarOpen);
  };

  const toggleDarkMode = () => {
    const newDarkMode = !darkMode;
    setDarkMode(newDarkMode);
    document.body.classList.toggle('dark-mode', newDarkMode);
    localStorage.setItem('darkMode', newDarkMode);
  };

  // Load dark mode preference
  useEffect(() => {
    const savedDarkMode = localStorage.getItem('darkMode') === 'true';
    setDarkMode(savedDarkMode);
    document.body.classList.toggle('dark-mode', savedDarkMode);
  }, []);

  const markAllAsRead = () => {
    const updatedNotifications = notifications.map(notif => ({ ...notif, read: true }));
    setNotifications(updatedNotifications);
    setUnreadCount(0);
  };

  const toggleNotifications = () => {
    setShowNotifications(!showNotifications);
  };

  const handleNotificationClick = () => {
    setShowNotifications(!showNotifications);
  };

  // Close notifications when clicking outside
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (showNotifications && !event.target.closest('.notification-wrapper')) {
        setShowNotifications(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => document.removeEventListener('mousedown', handleClickOutside);
  }, [showNotifications]);

  if (!studentData) {
    return (
      <div className="loading-dashboard">
        <div className="loading-spinner"></div>
        <p>Loading student data...</p>
      </div>
    );
  }

  // Navigation items
  const navItems = [
    { 
      id: 'dashboard', 
      icon: 'ðŸ“Š', 
      label: 'Dashboard', 
      component: <DashboardHome studentData={studentData} onCORNavigate={handleOpenCORModal} />
    },
    { 
      id: 'academics', 
      icon: 'ðŸ“š', 
      label: 'Academic Records', 
      component: <AcademicSection studentData={studentData} onCORNavigate={handleOpenCORModal} />
    },
    { 
      id: 'documents', 
      icon: 'ðŸ“„', 
      label: 'Online Documents', 
      component: <DocumentsSection studentData={studentData} />
    },
    { 
      id: 'scheduler', 
      icon: 'ðŸ“…', 
      label: 'Request Scheduler', 
      component: <SchedulerSection />
    },
    { 
      id: 'applications', 
      icon: 'ðŸ“‹', 
      label: 'Applications', 
      component: <ApplicationsSection />
    },
    { 
      id: 'profile', 
      icon: 'ðŸ‘¤', 
      label: 'My Profile', 
      component: <ProfileSection studentData={studentData} />
    },
    { 
      id: 'settings', 
      icon: 'âš™ï¸', 
      label: 'Account Settings', 
      component: <SettingsSection darkMode={darkMode} toggleDarkMode={toggleDarkMode} />
    },
    { 
      id: 'resources', 
      icon: 'ðŸ›ï¸', 
      label: 'Campus Resources', 
      component: <ResourcesSection />
    },
  ];

  const activeComponent = navItems.find(item => item.id === activeSection)?.component;

  return (
    <div className={`student-dashboard ${sidebarOpen ? 'sidebar-open' : 'sidebar-collapsed'} ${darkMode ? 'dark-mode' : ''}`}>
      {/* Floating COR Button */}
      <FloatingCORButton onClick={handleOpenCORModal} />

      {/* COR Modal */}
      {showCORModal && (
        <div className="cor-modal-overlay" onClick={handleCloseCORModal}>
          <div className="cor-modal" onClick={(e) => e.stopPropagation()}>
            <div className="cor-modal-header">
              <h2>ðŸŽ“ Certificate of Registration Generator</h2>
              <button className="cor-modal-close" onClick={handleCloseCORModal}>
                Ã—
              </button>
            </div>
            <div className="cor-modal-content">
              <CertificateOfRegistration studentData={studentData} onClose={handleCloseCORModal} />
            </div>
          </div>
        </div>
      )}

      {/* Sidebar Navigation */}
      <div className="sidebar">
        <div className="sidebar-header">
          <div className="logo-section">
            <img src="/logo-ptc.png" alt="PTC Logo" className="sidebar-logo" />
            {sidebarOpen && <span className="college-name">Pateros Technological College</span>}
          </div>
          <button className="sidebar-toggle" onClick={toggleSidebar}>
            {sidebarOpen ? 'â—€' : 'â–¶'}
          </button>
        </div>

        <nav className="sidebar-nav">
          {navItems.map(item => {
            const isApplications = item.id === 'applications';
            return (
              <button
                key={item.id}
                className={`nav-item ${activeSection === item.id ? 'active' : ''}`}
                onClick={() => {
                  setActiveSection(item.id);
                  setShowNotifications(false);
                }}
              >
                <span className="nav-icon">{item.icon}</span>
                {sidebarOpen && <span className="nav-label">{item.label}</span>}
                {isApplications && unreadCount > 0 && (
                  <span className="notification-badge">{unreadCount}</span>
                )}
              </button>
            );
          })}
        </nav>

        <div className="sidebar-footer">
          <div className="user-info">
            <div className="user-avatar">
              {studentData.first_name?.[0]}{studentData.last_name?.[0]}
            </div>
            {sidebarOpen && (
              <div className="user-details">
                <div className="user-name">{studentData.first_name} {studentData.last_name}</div>
